import React from 'react'

function CommentsMatch() {
    return (
        <div>
            <span style={{ background: "#E5007D", width: "50%", padding: 10, color: "#fff" }}>Matched</span>
            <span style={{ background: "#767680", width: "50%", padding: 10, color: "#818E94" }}>Not matched</span>
        </div>
    )
}

export default CommentsMatch
